import React from 'react';
import './Header.css';

const Header: React.FC = () => {
  return (
    <header className="header">
      <div className="header-content">
        <div className="header-left">
          <h1 className="header-title">Maestro (AI Meeting Master)</h1>
          <p className="header-description">
            AI 기반 회의 관리 시스템으로 회의 등록, 실시간 회의 기록 및 정리, 회의록 배포 등을 수행할 수 있습니다
          </p>
        </div>
        <nav className="header-nav">
          <button className="nav-link">회의 목록</button>
          <button className="nav-link">+ 새 회의 등록</button>
          <button className="nav-link">DB 상태</button>
        </nav>
      </div>
    </header>
  );
};

export default Header;
